import React, { useState } from "react";
import axios from 'axios'
import { Link, useNavigate } from "react-router-dom";
import Button from "react-bootstrap/esm/Button";


const PlaceOd = () => {
  const [order, setOrder] = useState({
    mobileNo: "",
    productName: "",
    couponCode: "",
})
  const { mobileNo, productName, couponCode} = Order;
  const onInputChange = e => {
    setOrder({ ...Order, [e.target.name]: e.target.value}); //name :value
  };

  const onSubmit = async(e) => {
    e.preventDefault();
    await axios.post("http://localhost:8080/placeorder", Order);
    history("/");
  };
  return (
    <div className="container">
      <div className="w-75 mx-auto shadow p-5">
        <h2 className="text-center mb-4">Place Order</h2>
        <form onSubmit={e => onSubmit(e)}>
          <div className="form-group">
            <input
              type="text"
              className="form-control form-control-lg"
              placeholder="Enter Your mobileNo"
              name="mobileNo"
              value={mobileNo}
              onChange={e => onInputChange(e)}
            />
          </div>
          <div className="form-group">
            <input
              type="text"
              className="form-control form-control-lg"
              placeholder="Enter Your productName"
              name="productName"
              value={productName}
              onChange={e => onInputChange(e)}
            />
          </div>
          <div className="form-group">
            <input
              type="text"
              className="form-control form-control-lg"
              placeholder="Enter Your couponCode"
              name="couponCode"
              value={couponCode}
              onChange={e => onInputChange(e)}
            />
          </div>
          <Button className="btn btn-primary btn-block">Place order</Button>
          <Link to ="/">
          <Button className="btn btn-primary btn-block">concle</Button></Link>
        </form>
      </div>
    </div>
  );
};


export default PlaceOd;
